INSERT INTO public.products (id, name, brand, category, "productCategory", "productType", description, image_url, product_link, ingredients, suitable_skin_types, "targetConcerns", tags, "tagList", price, "budgetRange", rating, api_source_id, api_source, last_updated, "isAvailable", "isNonComedogenic", "isHypoallergenic", "isOrganic", "isCrueltyFree", "createdAt", "updatedAt") VALUES ('93594a78-a76c-4079-b41f-2bf3bcc18155', 'No Filter Foundation', 'colourpop', NULL, 'liquid', 'foundation', 'Developed for the Selfie Age, our buildable full coverage, natural matte foundation delivers flawless looking skin from day-to-night. The oil-free, lightweight formula blends smoothly and is easily customizable to create the coverage you want. Build it up or sheer it out, it was developed with innovative soft-blurring pigments to deliver true color while looking and feeling natural. The lockable pump is easy to use and keeps your routine mess-free! As always, 100% cruelty-free and vegan.', 'https://cdn.shopify.com/s/files/1/1338/0845/products/foundations-lineup_800x1200.jpg?v=1528927785', 'https://colourpop.com/products/no-filter-matte-foundation', NULL, '{normal,combination}', NULL, NULL, '{"cruelty free",Vegan}', 12.00, 'budget', NULL, '1045', 'makeup_api', '2025-10-19 15:36:36.408', true, false, false, false, true, '2025-10-19 16:36:36.469614', '2025-10-19 16:36:36.469614');
INSERT INTO public.products (id, name, brand, category, "productCategory", "productType", description, image_url, product_link, ingredients, suitable_skin_types, "targetConcerns", tags, "tagList", price, "budgetRange", rating, api_source_id, api_source, last_updated, "isAvailable", "isNonComedogenic", "isHypoallergenic", "isOrganic", "isCrueltyFree", "createdAt", "updatedAt") VALUES ('2adf4fb6-89aa-4d24-b7a7-826904c6d105', 'Lipstick', 'boosh', NULL, 'lipstick', 'lipstick', 'All of our products are free from lead and heavy metals, parabens, phthalates, artificial colourants, and synthetic fragrances.  Boosh lipstick glides on smoothly for clean & protective SPF coverage. They are filled with hydrating oils and butters to preserve and enhance your lips natural surface. Organic sweet orange oil gives a light and cheerful scent.', 'https://cdn.shopify.com/s/files/1/1016/3243/products/LIPBALM_LID_grande.jpg?v=1496848378', 'https://www.boosh.ca/collections/all', NULL, '{normal,combination}', NULL, NULL, '{"Chemical Free",Organic}', 26.00, 'mid', NULL, '1044', 'makeup_api', '2025-10-19 15:36:36.408', true, false, false, true, false, '2025-10-19 16:36:36.469614', '2025-10-19 16:36:36.469614');
