INSERT INTO public.products (id, name, brand, category, "productCategory", "productType", description, image_url, product_link, ingredients, suitable_skin_types, "targetConcerns", tags, "tagList", price, "budgetRange", rating, api_source_id, api_source, last_updated, "isAvailable", "isNonComedogenic", "isHypoallergenic", "isOrganic", "isCrueltyFree", "createdAt", "updatedAt") VALUES ('ea9c1f86-8e55-4b3e-8792-3cec3735f081', 'Coverage Foundation', 'deciem', NULL, 'liquid', 'foundation', 'Coverage Foundations are full-coverage formulations available in a comprehensive shade range across 21 shades. These foundations contain higher pigment levels than our Serum Foundations but still offer a smooth finish that avoids the heavy makeup look that can make skin appear more aged. The texture is that of a lightweight, non-oily cream.', 'https://3bc01d2807fb1bc0d25c-a86d2521f1af8989841b9619f5314be5.ssl.cf1.rackcdn.com/products/market-img/rdn-coverage-foundation-33-n-30ml.png?v=daa322f179d80e450613c75826602292', 'https://deciem.com/product/rdn-coverage-foundation-33-n-30ml', NULL, '{normal,combination}', NULL, NULL, '{"water free","cruelty free","alcohol free","oil free","silicone free",Vegan,"Gluten Free"}', 6.90, 'budget', NULL, '1042', 'makeup_api', '2025-10-19 15:36:36.408', true, false, false, false, true, '2025-10-19 16:36:36.469614', '2025-10-19 16:36:36.469614');
INSERT INTO public.products (id, name, brand, category, "productCategory", "productType", description, image_url, product_link, ingredients, suitable_skin_types, "targetConcerns", tags, "tagList", price, "budgetRange", rating, api_source_id, api_source, last_updated, "isAvailable", "isNonComedogenic", "isHypoallergenic", "isOrganic", "isCrueltyFree", "createdAt", "updatedAt") VALUES ('bc6b20e5-ab3a-43ce-8ed2-539f746281b3', 'Liquid Liner', 'zorah biocosmetiques', NULL, 'liquid', 'eyeliner', '<strong>12 hours of long-lasting</strong> intense color, transfer-free (leaves no trace on crease above the eyelid) <strong>Pure Light Capture®</strong> <strong>minerals</strong> deliver color and radiance. Silky lines and refreshingly light, Pure Argan eyeliner leaves a weightless feel on the eyelids.<p align=''LEFT''>Natural cosmetic certified by Ecocert Greenlife according to Ecocert Standard available at: http://cosmetiques.ecocert.com</p>98% of the total ingredients are from natural origin 5% of total ingredients are from organic farming', 'https://www.purpicks.com/wp-content/uploads/2018/06/Zorah-Biocosmetiques-Liquid-Liner.png', 'https://www.purpicks.com/product/zorah-biocosmetiques-liquid-liner/', NULL, '{normal,combination}', NULL, NULL, '{purpicks,EcoCert}', 0.00, 'mid', NULL, '1041', 'makeup_api', '2025-10-19 15:36:36.408', true, false, false, false, false, '2025-10-19 16:36:36.469614', '2025-10-19 16:36:36.469614');
INSERT INTO public.products (id, name, brand, category, "productCategory", "productType", description, image_url, product_link, ingredients, suitable_skin_types, "targetConcerns", tags, "tagList", price, "budgetRange", rating, api_source_id, api_source, last_updated, "isAvailable", "isNonComedogenic", "isHypoallergenic", "isOrganic", "isCrueltyFree", "createdAt", "updatedAt") VALUES ('bd4dc4fd-8103-4040-ae0a-8f585497622b', 'Eyeshadow', 'zorah biocosmetiques', NULL, '', 'eyeshadow', '<strong>Product Description</strong>Anti-aging formula made with organic Pure Argan oil and Pure Light Capture<sup>®</sup> pigments. 24 Hour crease-free intensity (no build-up increase of eyelid), no running. Pure Light Capture® pigments deliver color and luminosity. Silky and refreshingly light feel, Pure Argan eyeshadow is weightless on the eyelids. Pure Argan eyeshadow <strong>soothes</strong>, <strong>hides redness </strong>and <strong>slows the appearance of the signs of aging on the skin.</strong><p align=''LEFT''>Natural cosmetic certified by Ecocert Greenlife according to Ecocert Standard available at: http://cosmetiques.ecocert.com</p>100% of the total ingredients are from natural origin5% of total ingredients are from organic farming', 'https://www.purpicks.com/wp-content/uploads/2018/02/Ombre-Amazonie-CC.png', 'https://www.purpicks.com/product/zorah-eyeshadow/', NULL, '{normal,combination}', NULL, NULL, '{purpicks,EcoCert}', 0.00, 'mid', NULL, '1040', 'makeup_api', '2025-10-19 15:36:36.408', true, false, false, false, false, '2025-10-19 16:36:36.469614', '2025-10-19 16:36:36.469614');
INSERT INTO public.products (id, name, brand, category, "productCategory", "productType", description, image_url, product_link, ingredients, suitable_skin_types, "targetConcerns", tags, "tagList", price, "budgetRange", rating, api_source_id, api_source, last_updated, "isAvailable", "isNonComedogenic", "isHypoallergenic", "isOrganic", "isCrueltyFree", "createdAt", "updatedAt") VALUES ('a2782a7b-4a6b-4a08-abf3-18564a1f5245', 'Loose Mineral Eyeshadow', 'marienatie', NULL, '', 'eyeshadow', 'Long-lasting eye colours delivering an instant glam and shimmer.  Silky and soft texture of MarieNatie glides on easily when applied wet or dry.  Magnesium stearate repels water and will help keep your eye shadow on all day and absorb any extra oil.  Kaolin clay will help to purify, soothe different skin types.', 'https://www.purpicks.com/wp-content/uploads/csm/Loose_MineralEyeshadow_1024x1024_a958d62b-c518-4548-a2cd-9c8981f5edee1.jpg', 'https://www.purpicks.com/product/marie-natie-loose-mineral-eyeshadow/', NULL, '{normal,combination}', NULL, NULL, '{purpicks,CertClean}', 0.00, 'mid', NULL, '1024', 'makeup_api', '2025-10-19 15:36:36.408', true, false, false, false, false, '2025-10-19 16:36:36.469614', '2025-10-19 16:36:36.469614');
INSERT INTO public.products (id, name, brand, category, "productCategory", "productType", description, image_url, product_link, ingredients, suitable_skin_types, "targetConcerns", tags, "tagList", price, "budgetRange", rating, api_source_id, api_source, last_updated, "isAvailable", "isNonComedogenic", "isHypoallergenic", "isOrganic", "isCrueltyFree", "createdAt", "updatedAt") VALUES ('5f9476f3-c2c7-4100-bc5a-ff6b0c108cd2', ' Realist Invisible Setting Powder', 'w3llpeople', NULL, 'powder', 'foundation', '<span style="font-weight: 400;">Keep it real with a polished, soft-focus look using this superfine, loose mineral powder. The healing properties of organic aloe help soothe and calm stressed out skin. Instantly minimize pores, soften imperfections, and creates a matte finish with superfine powder. Use by itself for an air-brushed look, or to set foundation for ultra-long wear.</span><span style="font-weight: 400;">* Set makeup or by itself for matte air-brushed effect</span><span style="font-weight: 400;">* Absorbs excess oil while softening fine lines</span><span style="font-weight: 400;">* Organic aloe creates radiant, rejuvenated skin</span><span style="font-weight: 400;">* Hypoallergenic, Chemical Free, Cruelty Free &amp; Noncomedogenic </span><span style="font-weight: 400;">* EWG Verified for non-toxic health and safety</span><span style="font-weight: 400;">* Free From: Parabens, Gluten, GMO, Phthalates, Sulfates, Fragrance, Pheonoxyethanol, Dimethicone, PEG, Propylene Glycol, Butylene Glycol, Lead, Mineral Oil, Talc</span>', 'https://www.purpicks.com/wp-content/uploads/2018/06/w3llpeople-Realist-Invisible-Setting-Powder.jpg', 'https://www.purpicks.com/product/w3llpeople-realist-invisible-setting-powder/', NULL, '{normal,combination}', NULL, NULL, '{"EWG Verified",purpicks,"Gluten Free"}', 0.00, 'mid', NULL, '1039', 'makeup_api', '2025-10-19 15:36:36.408', true, false, false, false, false, '2025-10-19 16:36:36.469614', '2025-10-19 16:36:36.469614');
INSERT INTO public.products (id, name, brand, category, "productCategory", "productType", description, image_url, product_link, ingredients, suitable_skin_types, "targetConcerns", tags, "tagList", price, "budgetRange", rating, api_source_id, api_source, last_updated, "isAvailable", "isNonComedogenic", "isHypoallergenic", "isOrganic", "isCrueltyFree", "createdAt", "updatedAt") VALUES ('4d2058b8-bc59-42cc-afa7-88b3380bd1bc', 'B Smudged', 'sally b''s skin yummies', NULL, '', 'eyeshadow', 'Let your eyes naturally pop with our B Smudged, a subtle eye color that adds a tint of color to the base of your lashes. An organic, cream eye color, B Smudged eliminates the inevitable uneven line from traditional eyeliners, and does not require expert blending techniques of messy, powder-based shadows. Simply ''smudge'' along lash line for color that stays in place for a long lasting look.', 'https://www.purpicks.com/wp-content/uploads/2018/06/Sally-B_s-Skin-Yummies-B-Smudged-1.jpg', 'https://www.purpicks.com/product/sally-bs-skin-yummies-b-smudged/', NULL, '{normal,combination}', NULL, NULL, '{"EWG Verified",purpicks}', 0.00, 'mid', NULL, '1038', 'makeup_api', '2025-10-19 15:36:36.408', true, false, false, false, false, '2025-10-19 16:36:36.469614', '2025-10-19 16:36:36.469614');
INSERT INTO public.products (id, name, brand, category, "productCategory", "productType", description, image_url, product_link, ingredients, suitable_skin_types, "targetConcerns", tags, "tagList", price, "budgetRange", rating, api_source_id, api_source, last_updated, "isAvailable", "isNonComedogenic", "isHypoallergenic", "isOrganic", "isCrueltyFree", "createdAt", "updatedAt") VALUES ('12685713-6b72-4882-b47a-2ee64780e317', 'B Glossy Lip Gloss', 'sally b''s skin yummies', NULL, 'lip_gloss', 'lipstick', 'Intensify your natural lip color with Sally B''s B Glossy Lip Gloss, an organic lip gloss that adds a silky smooth hint of color and shimmer to lips. Formulated with 98% certified organic, moisture-rich ingredients our B Glossy Lip Gloss works to enrich lip health for lips that feel good and look even better.', 'https://www.purpicks.com/wp-content/uploads/2018/06/Sally-B_s-Skin-Yummies-B-Glossy-Lip-Gloss.jpg', 'https://www.purpicks.com/product/sally-bs-skin-yummies-b-glossy-lip-gloss/', NULL, '{normal,combination}', NULL, NULL, '{"EWG Verified",purpicks}', 0.00, 'mid', NULL, '1037', 'makeup_api', '2025-10-19 15:36:36.408', true, false, false, false, false, '2025-10-19 16:36:36.469614', '2025-10-19 16:36:36.469614');
INSERT INTO public.products (id, name, brand, category, "productCategory", "productType", description, image_url, product_link, ingredients, suitable_skin_types, "targetConcerns", tags, "tagList", price, "budgetRange", rating, api_source_id, api_source, last_updated, "isAvailable", "isNonComedogenic", "isHypoallergenic", "isOrganic", "isCrueltyFree", "createdAt", "updatedAt") VALUES ('885f65a6-9de9-4a37-ad15-bfb22f48a5ee', 'Multi Purpose Powder - Blush & Eye', 'rejuva minerals', NULL, '', 'eyeshadow', 'Our Multi Purpose Pressed Powders may be used for blush or eye shadow. Blended with antioxidants from Certified Organic Fruits, Berries &amp; Botanicals*. Made without any gluten containing ingredients. Mica free Pink Parfait and Papaya will offer a natural, ultra sheer semi-matte finish. The petals from beautiful crushed red roses that are found in Pink Parfait, are valued for their natural color and delightful aroma that they provide! Acai Berry will offer a natural, ultra sheer satin finish (mica added). VEGAN. Image one is Pink Parfait. Image two is Papaya, and image three is Acai Berry. Model in image four is wearing Papaya. Model in image five is wearing Acai Berry. To see a demonstration of Papaya, click on the video and fast forward to 3:44. Enjoy! This product is EWG VERIFIED&#x2122; and rated ''CLEAN''in the Think Dirty app! BPA and Phthalate free packaging. Plastic parts of compacts are recyclable. *Tiny flecks of fruit and botanical particles may be visible in powder. Pink Parfait and Papaya are Titanium Dioxide and Mica free. Net Weight: 2.8 gm.', 'https://www.purpicks.com/wp-content/uploads/2018/06/Rejuva-Minerals-Multi-Purpose-Powder-Blush-_-Eye-1.jpg', 'https://www.purpicks.com/product/rejuva-minerals-multi-purpose-powder-blush-eye/', NULL, '{normal,combination}', NULL, NULL, '{"EWG Verified",purpicks,Hypoallergenic,"No Talc"}', 0.00, 'mid', NULL, '1036', 'makeup_api', '2025-10-19 15:36:36.408', true, false, true, false, false, '2025-10-19 16:36:36.469614', '2025-10-19 16:36:36.469614');
