INSERT INTO public.products (id, name, brand, category, "productCategory", "productType", description, image_url, product_link, ingredients, suitable_skin_types, "targetConcerns", tags, "tagList", price, "budgetRange", rating, api_source_id, api_source, last_updated, "isAvailable", "isNonComedogenic", "isHypoallergenic", "isOrganic", "isCrueltyFree", "createdAt", "updatedAt") VALUES ('4c8a7cd0-1c9d-4e1d-9596-5b101a692a7e', 'Conch Lipstick', 'coastal classic creation', NULL, 'lipstick', 'lipstick', 'Coastal Classic Creations Conch Lipstick is a flattering, stylish, rich winterberry color. This lipstick is paraben-free and vegan and contains sunflower oil which is rich in Vitamin E and which may protect against damage from the sun. To boost the product''s effectiveness, we add sesame seed oil which contains Vitamins E, D, and B complex to provide moisture and neutralize free radicals. Companions well with Boysenberry Lip Crayon.', 'https://www.purpicks.com/wp-content/uploads/2018/06/coastal-classic-creations-conch-lipstick.png', 'https://www.purpicks.com/product/coastal-classic-creations-conch-lipstick/', NULL, '{normal,combination}', NULL, NULL, '{"EWG Verified",purpicks,Hypoallergenic,"No Talc"}', 0.00, 'mid', NULL, '1010', 'makeup_api', '2025-10-19 15:36:36.408', true, false, true, false, false, '2025-10-19 16:36:36.469614', '2025-10-19 16:36:36.469614');
