INSERT INTO public.products (id, name, brand, category, "productCategory", "productType", description, image_url, product_link, ingredients, suitable_skin_types, "targetConcerns", tags, "tagList", price, "budgetRange", rating, api_source_id, api_source, last_updated, "isAvailable", "isNonComedogenic", "isHypoallergenic", "isOrganic", "isCrueltyFree", "createdAt", "updatedAt") VALUES ('9c013ba2-0dfb-40b3-87f7-6159c388d36a', 'Muse Mascara', 'c''est moi', NULL, '', 'mascara', 'Define, lengthen and nourish lashes with organic shea butter, grapeseed and jojoba oils. Lashes are coated gently and evenly without clumping, transferring or flaking. Long, lush lashes begin with this luxe mascara that is formulated with organic shea butter and oils of grape and jojoba seed to help nourish and condition as it lengthens and defines. Velvety and smooth, it coats lashes gently and evenly without clumping, transferring, or flaking. Made for Young Delicate Skin Types. NO – Talc, Fragrance, Parabens, Phthalates, Sulfates, Mineral oil or Propylene Glycol', 'https://www.purpicks.com/wp-content/uploads/2018/04/cest-moi-muse-mascara.png', 'https://www.purpicks.com/product/muse-mascara/', NULL, '{normal,combination}', NULL, NULL, '{"EWG Verified",purpicks,Hypoallergenic,"No Talc"}', 0.00, 'mid', NULL, '1008', 'makeup_api', '2025-10-19 15:36:36.408', true, false, true, false, false, '2025-10-19 16:36:36.469614', '2025-10-19 16:36:36.469614');
INSERT INTO public.products (id, name, brand, category, "productCategory", "productType", description, image_url, product_link, ingredients, suitable_skin_types, "targetConcerns", tags, "tagList", price, "budgetRange", rating, api_source_id, api_source, last_updated, "isAvailable", "isNonComedogenic", "isHypoallergenic", "isOrganic", "isCrueltyFree", "createdAt", "updatedAt") VALUES ('037da88e-07d9-4828-b73a-3afebb362edb', 'Luminary Lip Crayon', 'c''est moi', NULL, 'pencil', 'lip_liner', 'These nourishing and creamy lip crayons come in 6 perfectly pigmented shades that go from subtle to statement. This easy-to-use lip crayon delivers velvety application and perfectly pigmented color, plus a nourishing formula with a creamy, consistent texture designed to make your lips appear soft and smooth. Apply sparingly for a subtle look, or generously to make a statement—either way, your lips will feel as beautiful as they look! Made for Young Delicate Skin Types NO – Talc, Fragrance, Parabens, Phthalates, Sulfates, Mineral oil or Propylene Glycol Dermatologist Tested Clinically Tested On Sensitive Skin Hypoallergenic', 'https://www.purpicks.com/wp-content/uploads/2018/04/cest-moi-luminary-lip-crayon.png', 'https://www.purpicks.com/product/luminary-lip-crayon/', NULL, '{normal,combination}', NULL, NULL, '{"EWG Verified",purpicks,Hypoallergenic,"No Talc"}', 0.00, 'mid', NULL, '1007', 'makeup_api', '2025-10-19 15:36:36.408', true, false, true, false, false, '2025-10-19 16:36:36.469614', '2025-10-19 16:36:36.469614');
INSERT INTO public.products (id, name, brand, category, "productCategory", "productType", description, image_url, product_link, ingredients, suitable_skin_types, "targetConcerns", tags, "tagList", price, "budgetRange", rating, api_source_id, api_source, last_updated, "isAvailable", "isNonComedogenic", "isHypoallergenic", "isOrganic", "isCrueltyFree", "createdAt", "updatedAt") VALUES ('8c3db26d-3389-4b0e-9e62-7a4690fa903c', 'Fearless Eyeliner', 'c''est moi', NULL, 'pencil', 'eyeliner', 'Make eyes pop with this velvety smooth eyeliner that glides on effortlessly and precisely. Make your eyes pop with this sleek, easy-to-use eyeliner. Formulated with both jojoba seed oil and shea butter, its velvety smooth formula glides on effortlessly and precisely. To sharpen, place inside sharpener and turn the pencil gently to create a working tip. Made for Young Delicate Skin Types NO – Talc, Fragrance, Parabens, Phthalates, Sulfates, Mineral oil or Propylene Glycol  Dermatologist Tested Clinically Tested on Sensitive Skin Hypoallergenic Made with Natural Ingredients', 'https://www.purpicks.com/wp-content/uploads/2018/04/cest-moi-fearless-eyeliner-pencil.png', 'https://www.purpicks.com/product/fearless-eyeliner/', NULL, '{normal,combination}', NULL, NULL, '{"EWG Verified",purpicks,Hypoallergenic,"No Talc"}', 0.00, 'mid', NULL, '1006', 'makeup_api', '2025-10-19 15:36:36.408', true, false, true, false, false, '2025-10-19 16:36:36.469614', '2025-10-19 16:36:36.469614');
INSERT INTO public.products (id, name, brand, category, "productCategory", "productType", description, image_url, product_link, ingredients, suitable_skin_types, "targetConcerns", tags, "tagList", price, "budgetRange", rating, api_source_id, api_source, last_updated, "isAvailable", "isNonComedogenic", "isHypoallergenic", "isOrganic", "isCrueltyFree", "createdAt", "updatedAt") VALUES ('90cda906-a694-4d96-bbfb-0e1e55ebbb5a', 'Liquid Eye Shadow', 'alva', NULL, 'cream', 'eyeshadow', 'Our Liquid Edition Eye Shadows have been a real winner since their launch and are a real first of their kind in natural and organic make-up. Whether you''re looking for a striking or glamorous look for night time, or something more subtle and natural for wearing during the day, there is a shade for everyone. They dry quickly, and depending on the depth of colour desired, can be blended in on application or left to dry before blending for a more vivid look. Layering is also possible, but however you choose to use these liquid eye shadows they won''t gather in crow''s feet or fine lines around the eyes. The inclusion of patented beta glucan also means they''re perfect for sensitive eyes. Pale Almond is subtle, natural, and perfect for daytime wear, and compliments our Bronzed Hazel liquid eye shadow if a duo tone is desired.', 'http://www.purpicks.com/wp-content/uploads/2018/06/Alva-Liquid-Eye-Shadow-1-Pale-Almond.png', 'http://www.purpicks.com/product/alva-liquid-eye-shadow-1-pale-almond/', NULL, '{normal,combination}', NULL, NULL, '{purpicks,Organic,Vegan}', 9.95, 'budget', NULL, '1005', 'makeup_api', '2025-10-19 15:36:36.408', true, false, false, true, true, '2025-10-19 16:36:36.469614', '2025-10-19 16:36:36.469614');
INSERT INTO public.products (id, name, brand, category, "productCategory", "productType", description, image_url, product_link, ingredients, suitable_skin_types, "targetConcerns", tags, "tagList", price, "budgetRange", rating, api_source_id, api_source, last_updated, "isAvailable", "isNonComedogenic", "isHypoallergenic", "isOrganic", "isCrueltyFree", "createdAt", "updatedAt") VALUES ('9babbcab-0e97-4f37-ac86-d872995d96c0', 'Stretch Concealer', 'glossier', NULL, 'concealer', 'foundation', 'A traditional concealer sets to a stiff, flat, dry finish—a dead giveaway that you’re wearing it. Ours is a new type of concealer with elastic micro waxes that move with your face instead of caking on top of it, and nourishing oils that give a dewy, glowing finish. The buildable formula covers everything from dark circles to redness and blemishes. In five shades painstakingly developed to enhance, brighten, and—most importantly—completely disappear into the widest range of skin tones.', 'https://static-assets.glossier.com/production/spree/images/attachments/000/001/631/portrait_normal/SC_Carousel_1_copy_2.jpg?1506948615', 'https://www.glossier.com/products/stretch-concealer', NULL, '{normal,combination}', NULL, NULL, '{}', 22.00, 'mid', NULL, '1004', 'makeup_api', '2025-10-19 15:36:36.408', true, false, false, false, false, '2025-10-19 16:36:36.469614', '2025-10-19 16:36:36.469614');
INSERT INTO public.products (id, name, brand, category, "productCategory", "productType", description, image_url, product_link, ingredients, suitable_skin_types, "targetConcerns", tags, "tagList", price, "budgetRange", rating, api_source_id, api_source, last_updated, "isAvailable", "isNonComedogenic", "isHypoallergenic", "isOrganic", "isCrueltyFree", "createdAt", "updatedAt") VALUES ('979c35d7-a2b5-40cc-91dd-bcb7b23a6d9e', 'Cloud Paint', 'glossier', NULL, 'cream', 'blush', 'With Cloud Paint, we set out to make blush the high point of your routine. The pillowy, gel-cream formula is designed to be the most user-friendly cheek color in existence. If you can finger paint, you can Cloud Paint—simply dab it onto cheeks wherever you please. It’s seamless, sheer, and buildable (i.e. it’s hard to accidentally apply too much). Inspired by gradient pink NYC sunsets, the shades are optimized to work across a wide range of skin tones for a healthy, flushed-from-within glow.', 'https://static-assets.glossier.com/production/spree/images/attachments/000/001/241/portrait_normal/CP_PDP_02.jpg?1488382023', 'https://www.glossier.com/products/cloud-paint', NULL, '{normal,combination}', NULL, NULL, '{}', 22.00, 'mid', NULL, '1003', 'makeup_api', '2025-10-19 15:36:36.408', true, false, false, false, false, '2025-10-19 16:36:36.469614', '2025-10-19 16:36:36.469614');
INSERT INTO public.products (id, name, brand, category, "productCategory", "productType", description, image_url, product_link, ingredients, suitable_skin_types, "targetConcerns", tags, "tagList", price, "budgetRange", rating, api_source_id, api_source, last_updated, "isAvailable", "isNonComedogenic", "isHypoallergenic", "isOrganic", "isCrueltyFree", "createdAt", "updatedAt") VALUES ('cdd76114-f8c8-4b60-83fc-0c8baed7dc1d', 'Wowder', 'glossier', NULL, 'powder', 'foundation', 'It’s not powder, it’s Wowder—for non-dewy days. Wowder will: cut shine, blur the appearance of pores, set makeup, look like skin. Wowder won’t: leave a chalky film, cake into fine lines, flatten skin’s texture, or announce its presence in photographs (no camera flashback). In three sheer, glowy, adaptable shades...because no skin tone is HD-white. Pair with the angelically soft Wowder Brush for all-over and targeted application—perfect size, perfect shape, perfect density for the optimal matte-not-flat finish.', 'https://static-assets.glossier.com/production/spree/images/attachments/000/001/476/portrait_normal/carousel-1.jpg?1501534121', 'https://www.glossier.com/products/wowder', NULL, '{normal,combination}', NULL, NULL, '{}', 27.00, 'mid', NULL, '1002', 'makeup_api', '2025-10-19 15:36:36.408', true, false, false, false, false, '2025-10-19 16:36:36.469614', '2025-10-19 16:36:36.469614');
INSERT INTO public.products (id, name, brand, category, "productCategory", "productType", description, image_url, product_link, ingredients, suitable_skin_types, "targetConcerns", tags, "tagList", price, "budgetRange", rating, api_source_id, api_source, last_updated, "isAvailable", "isNonComedogenic", "isHypoallergenic", "isOrganic", "isCrueltyFree", "createdAt", "updatedAt") VALUES ('9f55b7cd-cd53-4e5b-b8e1-f1c01329c90a', 'Haloscope', 'glossier', NULL, 'highlighter', 'foundation', 'Skincare + makeup = Haloscope, the galaxy’s first dew effect highlighter. It’s a dual-delivery formula: the outer halo is infused with genuine crystal extracts for all-day enlightenment, with a solid oil core of vitamin-rich moisturizers for a hydrated, dewy finish. Expect an otherworldly sheen that’s never dry, never glittery. Comes in…', 'https://static-assets.glossier.com/production/spree/images/attachments/000/001/109/portrait_normal/Haloscope_01-compressor.jpg?1498613775', 'https://www.glossier.com/products/haloscope', NULL, '{normal,combination}', NULL, NULL, '{}', 27.00, 'mid', NULL, '1001', 'makeup_api', '2025-10-19 15:36:36.408', true, false, false, false, false, '2025-10-19 16:36:36.469614', '2025-10-19 16:36:36.469614');
INSERT INTO public.products (id, name, brand, category, "productCategory", "productType", description, image_url, product_link, ingredients, suitable_skin_types, "targetConcerns", tags, "tagList", price, "budgetRange", rating, api_source_id, api_source, last_updated, "isAvailable", "isNonComedogenic", "isHypoallergenic", "isOrganic", "isCrueltyFree", "createdAt", "updatedAt") VALUES ('0413f6fc-9d7f-4e3d-a092-4a53f5f86473', 'Perfecting Skin Tint', 'glossier', NULL, NULL, 'foundation', 'In the land between bare skin and makeup makeup exists the imperceptible wash of color that is our Perfecting Skin Tint. What does it do? Evens out discoloration and leaves your face looking toned, smooth, and dewy. The breathable, ultra thin formula auto-fits to skin, making application as simple as throwing on moisturizer. What won’t it do? Hide your freckles, spackle your pores, or erase any other evidence that you are, in fact, a real human being.', 'https://static-assets.glossier.com/production/spree/images/attachments/000/000/726/portrait_normal/PST_Carousel_02-compressor.jpg?1470088244', 'https://www.glossier.com/products/perfecting-skin-tint', NULL, '{normal,combination}', NULL, NULL, '{}', 32.00, 'mid', NULL, '1000', 'makeup_api', '2025-10-19 15:36:36.408', true, false, false, false, false, '2025-10-19 16:36:36.469614', '2025-10-19 16:36:36.469614');
INSERT INTO public.products (id, name, brand, category, "productCategory", "productType", description, image_url, product_link, ingredients, suitable_skin_types, "targetConcerns", tags, "tagList", price, "budgetRange", rating, api_source_id, api_source, last_updated, "isAvailable", "isNonComedogenic", "isHypoallergenic", "isOrganic", "isCrueltyFree", "createdAt", "updatedAt") VALUES ('f1534199-c934-4582-a2c3-3dd1c5d569f5', 'Generation G', 'glossier', NULL, NULL, 'lipstick', 'Generation G is a new kind of lip color that gives the look and finish of just-blotted lipstick, without the blot. We’ve created a short list of the six most important shades, with dialed-down pigment loads for a casual look: Zip, Leo, Crush, and Jam, along with the super subtle Cake and Like, which give some oomph to lighter lip tones. They’re lipsticks that adapt to you, not the other way around, so they''ll appear a bit different on everyone as your natural lip color shows through. The effect? Diffused, matte goodness—just swipe it on.', 'https://static-assets.glossier.com/production/spree/images/attachments/000/001/239/portrait_normal/GenG2.jpg?1487709747', 'https://www.glossier.com/products/generation-g', NULL, '{normal,combination}', NULL, NULL, '{}', 20.00, 'mid', NULL, '999', 'makeup_api', '2025-10-19 15:36:36.408', true, false, false, false, false, '2025-10-19 16:36:36.469614', '2025-10-19 16:36:36.469614');
