INSERT INTO public.products (id, name, brand, category, "productCategory", "productType", description, image_url, product_link, ingredients, suitable_skin_types, "targetConcerns", tags, "tagList", price, "budgetRange", rating, api_source_id, api_source, last_updated, "isAvailable", "isNonComedogenic", "isHypoallergenic", "isOrganic", "isCrueltyFree", "createdAt", "updatedAt") VALUES ('0dda3bd9-c5c9-4988-bd29-3a461eab880f', 'Slide On Pencil', 'nyx', NULL, 'pencil', 'eyeliner', 'Don’t let the softness of this pencil fool you. This formula doesn''t smear or smudge and delivers powerful robust colors. It’s like a liquid eye liner without the mess. Available in 18 sleek shades. Our Slide on Pencils can be sharpened with a sharpener that has an opening for a small pencil. Get your NYX Professional Makeup Sharpener', 'https://www.nyxcosmetics.com/dw/image/v2/AANG_PRD/on/demandware.static/-/Sites-cpd-nyxusa-master-catalog/default/dwbdf94a20/ProductImages/Eyes/Slide_On_Pencil/slideonpencil_main.jpg?sw=390&sh=390&sm=fit', 'https://www.nyxcosmetics.com/slide-on-pencil/NYX_022.html?cgid=eyeliner', NULL, '{normal,combination}', NULL, NULL, '{}', 8.00, 'budget', NULL, '957', 'makeup_api', '2025-10-19 15:36:36.409', true, false, false, false, false, '2025-10-19 16:36:36.469614', '2025-10-19 16:36:36.469614');
