ntMedium-to-full buildable coverageOil-free, hydrating formula – without the shineLight diffusing spheres blur imperfections Sweat & humidity resistantColor-true, exercise-resistant & transfer-proofBlend well over skin with brush, sponge or fingertips—starting at center of face. Build your way to customizable coverage.', 'https://www.smashbox.com/media/images/products/388x396/sbx_sku_71596_388x396_0.jpg', 'http://www.smashbox.com/product/6035/22769/Face/Foundation-Powder/STUDIO-SKIN-15-HOUR-WEAR-HYDRATING-FOUNDATION', NULL, '{normal,combination}', NULL, NULL, '{}', 42.00, 'mid', NULL, '543', 'makeup_api', '2025-10-19 15:36:36.409', true, false, false, false, false, '2025-10-19 16:36:36.469614', '2025-10-19 16:36:36.469614');
