wders1 Brow Wax2 Highlighters1 Bronzer1 Contour Powder1 Double-Ended Shadow/Brow Brush#SHAPEMATTERS insert with how-to''sTo Use: Check out our #ShapeMatters insert for precise how-to''s by face, brow and eye shape.', 'https://www.smashbox.com/media/images/products/388x396/sbx_sku_62978_388x396_0.jpg', 'http://www.smashbox.com/product/6026/35669/eyes/brow/shapematters-palette/new', NULL, '{normal,combination}', NULL, NULL, '{}', 55.00, 'premium', NULL, '529', 'makeup_api', '2025-10-19 15:36:36.409', true, false, false, false, false, '2025-10-19 16:36:36.469614', '2025-10-19 16:36:36.469614');
