INSERT INTO public.products (id, name, brand, category, "productCategory", "productType", description, image_url, product_link, ingredients, suitable_skin_types, "targetConcerns", tags, "tagList", price, "budgetRange", rating, api_source_id, api_source, last_updated, "isAvailable", "isNonComedogenic", "isHypoallergenic", "isOrganic", "isCrueltyFree", "createdAt", "updatedAt") VALUES ('c59177f7-86af-4317-9482-dbcb6c59c460', 'MATTE EXPOSURE PALETTE', 'smashbox', NULL, 'palette', 'eyeshadow', 'This all-matte palette has you covered with its silky, blendable shadows that double as stay-put liners. Created in Smashbox’s L.A. photo studio for cover shots and pictures with a flash, these must-have matte shades are designed to make eyes pop without any reflective sheen. It includes a double-ended shadow/liner brush to line, define, and contour your eyes and a simple, step-by-step guide to getting a smoky, softly defined look and cat-eye for six different eye shapes.This palette contains: 12 x 0.035 oz Matte wet/dry eye shadow in Spice (burnt orange), Blackberry (deep burgundy), Desert (medium/neutral brown), Sumatra (deep brown), Tonal (peach nude), Suede (soft red brown), Buff (pink nude), Grounded (medium cool brown), Drizzle (muted purple), Black Plum (deep purple), Truffle (light grey), Blackout (black) 2 x 0.07 oz Matte base eye shadow shades in Wheat (soft warm brown), Vanilla (soft light beige)Double-ended shadow/liner brush Step-by-step guide The dark shades intensify and double as a liner when used wet.This all-matte palette has you covered with its silky, blendable shadows that double as stay-put liners. Created in Smashbox’s L.A. photo studio for cover shots and pictures with a flash, these must-have matte shades are designed to make eyes pop without any reflective sheen. It includes a double-ended shadow/liner brush to line, define, and contour your eyes and a simple, step-by-step guide to getting a smoky, softly defined look and cat-eye for six different eye shapes.This palette contains: 12 x 0.035 oz Matte wet/dry eye shadow in Spice (burnt orange), Blackberry (deep burgundy), Desert (medium/neutral brown), Sumatra (deep brown), Tonal (peach nude), Suede (soft red brown), Buff (pink nude), Grounded (medium cool brown), Drizzle (muted purple), Black Plum (deep purple), Truffle (light grey), Blackout (black) 2 x 0.07 oz Matte base eye shadow shades in Wheat (soft warm brown), Vanilla (soft light beige)Double-ended shadow/liner brush Step-by-step guide The dark shades intensify and double as a liner when used wet.', 'https://www.smashbox.com/media/images/products/388x396/sbx_sku_74764_388x396_0.jpg', 'http://www.smashbox.com/product/6029/44139/eyes/eye-shadow/matte-exposure-palette/new', NULL, '{normal,combination}', NULL, NULL, '{}', 49.00, 'mid', NULL, '524', 'makeup_api', '2025-10-19 15:36:36.409', true, false, false, false, false, '2025-10-19 16:36:36.469614', '2025-10-19 16:36:36.469614');
