INSERT INTO public.products (id, name, brand, category, "productCategory", "productType", description, image_url, product_link, ingredients, suitable_skin_types, "targetConcerns", tags, "tagList", price, "budgetRange", rating, api_source_id, api_source, last_updated, "isAvailable", "isNonComedogenic", "isHypoallergenic", "isOrganic", "isCrueltyFree", "createdAt", "updatedAt") VALUES ('1a8cafb1-a27d-468c-b5b1-ae7b61ceb7db', 'Stila Stay All Day Bronzer in Medium', 'stila', NULL, NULL, 'bronzer', 'The perfect complement to all skin tones, Stay All Day Bronzer is a lightweight, matte-satin powder that is ideal for accenting the face and body to perfection. Features are sculpted and shaped with long-wearing pigments that blend effortlessly for a natural-looking result.  This sun-kissed, bronze hue adds a touch of sun for a healthy glow all year round. Features:Velvety texture blends seamlessly onto the face and body with no streaking or cakingFade proof color stays true all day without oxidizingBuildable coverageOil-free, water-resistant formulaJumbo pan size allows for effortless brush applicationIngredients: Silica, Polymethyl Methacrylate, Octylodecyl Stearoyl Stearate, Ethylene/Acrylic Acid Copolymer, Pentaerythrityl Tetraisostearate, Hydrogen Dimethicone, Isopropyl Isostearate, Zinc Stearate, Magnesium Myristate, Diisostearyl Malate, Zinc Oxide, Ethylhexyl Methoxycinnamate, Triethoxycaprylylsilane, Caprylyl Glycol, Phenoxyethanol, Sorbic Acid, Mica. (+/-) Iron Oxides. (CI 77491, CI 77492, CI 77499) ', 'https://d3t32hsnjxo7q6.cloudfront.net/i/66cae20898e4b7204024554a17e382d6_ra,w158,h184_pa,w158,h184.png', 'https://well.ca/products/stila-stay-all-day-bronzer-in-medium_108656.html', NULL, '{normal,combination}', NULL, NULL, '{}', 46.99, 'mid', NULL, '512', 'makeup_api', '2025-10-19 15:36:36.409', true, false, false, false, false, '2025-10-19 16:36:36.469614', '2025-10-19 16:36:36.469614');
