INSERT INTO public.products (id, name, brand, category, "productCategory", "productType", description, image_url, product_link, ingredients, suitable_skin_types, "targetConcerns", tags, "tagList", price, "budgetRange", rating, api_source_id, api_source, last_updated, "isAvailable", "isNonComedogenic", "isHypoallergenic", "isOrganic", "isCrueltyFree", "createdAt", "updatedAt") VALUES ('73155c07-776a-4a68-a6cc-cce2f421b8fd', 'Pure Anada Loose Luminous Eye Colour ', 'pure anada', NULL, NULL, 'eyeshadow', 'Pure Anada Loose Luminous Eye Colours are made with finely milled micas that impart an illuminating glow.  Apply them dry for soft, subtle color, or wet for more vibrant intensity.  Learn how you can use your favourite shade to make customized lip balm with our easy DIY Lip Balm recipe on our blog, The Well!About Shade Tones: Warm Shades (W) if you have yellow undertones in your skinCool Shades (C) if you have blue undertones in your skinNeutral Shades (N) to accent any skin tone or eye colorApplication Tips: Dip your shadow brush into the loose minerals and tap off any excess 
powder.  Gently stipple the minerals on your eye lids.   Make sure your 
skin is well hydrated so the minerals will adhere.  Try misting your 
skin with Pure Anada Marine Mineral Toner, prior to applying your 
makeup.If your shadow is prone to creasing, make sure your lids are free 
from excess oils before applying shadow.  If the problem is persistant, 
try priming your lids with Pure Anada Matte Minerals Finishing Powder or
 a coordinating Velvet Matte Shadow.
Deep shades of loose mineral shadow can be used as eyeliner.  To 
create a soft dry line, dip an angled liner brush into the powder, tap 
it off and line your eyes.  Or to create a liquid liner, wet your brush 
and dip it into the powder.  The minerals will stick to the brush.  Make
 a paste on the back of your hand, or in the lid of the jar.  Apply to 
your eyes!Ingredients: Mica,  Iron Oxides, Ultramarines, May contain: Titanium Dioxide', 'https://d3t32hsnjxo7q6.cloudfront.net/i/4daf84bee451c265ec04f7cc1b8bb7c3_ra,w158,h184_pa,w158,h184.jpeg', 'https://well.ca/products/pure-anada-loose-luminous-eye-colour_93638.html', NULL, '{normal,combination}', NULL, NULL, '{Canadian,Natural}', 8.00, 'budget', 4.5, '281', 'makeup_api', '2025-10-19 15:36:36.41', true, false, false, true, false, '2025-10-19 16:36:36.469614', '2025-10-19 16:36:36.469614');
