sononanoate, Hydrogenated Coco-Glycerides, Euphorbia Cerifera Cera (Candelilla Wax), Cera Microcristallina (Microcrystalline Wax), Polymethyl Methacrylate, Silica, Copernicia Cerifera Cera (Carnauba Wax), Disteardimonium Hectorite, Tocopherol, Propylene Carbonate, Ascorbyl Palmitate, Mica, Titanium Dioxide (CI 77891), Iron Oxide (CI 77491). +/- May Contain: Iron Oxides (CI 77492, CI 77499). ', 'https://d3t32hsnjxo7q6.cloudfront.net/i/4c7b17775d8a73cf4585e20761098b79_ra,w158,h184_pa,w158,h184.png', 'https://well.ca/products/milani-brow-eye-highlighter-duo_89096.html?cat=324', NULL, '{normal,combination}', NULL, NULL, '{}', 6.99, 'budget', 3.3, '236', 'makeup_api', '2025-10-19 15:36:36.41', true, false, false, false, false, '2025-10-19 16:36:36.469614', '2025-10-19 16:36:36.469614');
