e, Caprylyl Glycol, Phenoxyethanol, Isopentyldiol, Tin Oxide, Titanium Dioxide (CI 77891), Iron Oxide (CI 77499). +/- May Contain: Iron Oxide (CI 77491), Ferric Ferrocyanide (CI 77510), Carmine (CI 75470), Ultramarines (CI 77007). ', 'https://d3t32hsnjxo7q6.cloudfront.net/i/98ff3db1b142c3f9f915a2e9a0dafa92_ra,w158,h184_pa,w158,h184.png', 'https://well.ca/products/milani-fierce-foil-eyeliner_101204.html', NULL, '{normal,combination}', NULL, NULL, '{}', 9.99, 'budget', NULL, '190', 'makeup_api', '2025-10-19 15:36:36.41', true, false, false, false, false, '2025-10-19 16:36:36.469614', '2025-10-19 16:36:36.469614');
