INSERT INTO public.products (id, name, brand, category, "productCategory", "productType", description, image_url, product_link, ingredients, suitable_skin_types, "targetConcerns", tags, "tagList", price, "budgetRange", rating, api_source_id, api_source, last_updated, "isAvailable", "isNonComedogenic", "isHypoallergenic", "isOrganic", "isCrueltyFree", "createdAt", "updatedAt") VALUES ('7d1c4eac-9d30-4b66-995b-652bfb975820', 'Orly EPIX Flexible Sealcoat', 'orly', NULL, NULL, 'nail_polish', 'Orly introduces the next big thing in the industry. EPIX Flexible Color is a 2 step manicure system that has a long wearing formula with smudge-fixing technology.Features:Dries faster - in less than 8 minutesLasts longer - over a weekInnovative Smudge-Fixing Technology allows the formula to remain elastic and flex with the nail, making smudges and chips a thing of the pastApplies easily and removes like a polishNew Custom 600 Bristle Count Brush Technology and Gripper Cap provide precise application and even coverage on the nailDelivers a high shine finishHow Does it Work?Step 1 Flexible Colour: Begin by performing a dry manicure. Lightly buff nails and clean nail surface with alcohol.  Apply an even coat of EPIX Flexible Color to all ten nails.  Apply a second coat for full coverageStep 2 Flexible Sealcoat: Finish with 1 coat of EPIX Flexible Sealcoat to seal in color and shine.  For extended wear, reapply Sealcoat after three days.* Smudges will continue to self-repair until the Flexible Color is fully dry.', 'https://d3t32hsnjxo7q6.cloudfront.net/i/648283e42d7fafb7c03e8c60274cd5e0_ra,w158,h184_pa,w158,h184.png', 'https://well.ca/products/orly-epix-flexible-sealcoat_106342.html?cat=678', NULL, '{normal,combination}', NULL, NULL, '{}', 13.49, 'budget', 5.0, '153', 'makeup_api', '2025-10-19 15:36:36.41', true, false, false, false, false, '2025-10-19 16:36:36.469614', '2025-10-19 16:36:36.469614');
